package dev.oliver.todobackend.domain;public class Account {    private String userName;    private String password;    private String email;    public Account() {}    public Account(String userName, String password) {        this.userName = userName;        this.password = password;    }    public Account(String userName, String password, String email) {        this.userName = userName;        this.password = password;        this.email = email;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getUserName() {        return userName;    }    public void setPassword(String password) {        this.password = password;    }    public String getPassword() {        return password;    }    public void setEmail(String email) {        this.email = email;    }    public String getEmail() {        return email;    }}